import { StatusBar } from 'expo-status-bar';
import { ImageBackground, StyleSheet, Text, View , Image, TouchableWithoutFeedback} from 'react-native';
import AppLoading from 'expo-app-loading'; //expo install expo-app-loading
import {
    useFonts,
    Cabin_400Regular,
} from '@expo-google-fonts/cabin';

import WrapperTutorial from "../components/wrapperTutorial";
import Page2text from '../components/page2text';
import Mslider from '../components/sliderState';
// <svg width="23" height="18" viewBox="0 0 23 18" fill="none" xmlns="http://www.w3.org/2000/svg">
const path=[
    "M5.62217 10.6069L21.2464 10.6069C22.1619 10.6069 22.9045 9.78149 22.9045 8.76312C22.9045 7.74505 22.1619 6.91935 21.2464 6.91935L5.7001 6.91935L9.01723 3.17958C9.66446 2.4599 9.66474 1.26668 9.01695 0.546382C8.36944 -0.173608 7.31956 -0.186207 6.67205 0.533783L0.485493 7.40672C-0.161739 8.1264 -0.162015 9.29074 0.485769 10.011L6.8351 17.0693C7.48261 17.7893 8.5325 17.7883 9.18 17.068C9.50362 16.7082 9.66556 16.2359 9.66556 15.7642C9.66556 15.2925 9.50362 14.8715 9.17973 14.5114L5.62217 10.6069Z",
]
const Tutorial2 = (props) =>{

    let [fontsLoaded] = useFonts({
        Cabin_400Regular,
    });
    if (!fontsLoaded) {
        return <AppLoading />;
    } else {
    return(
        <ImageBackground style={{height:'100%', position:'relative', justifyContent:'center', alignItems:'center'}} blurRadius={3} source={require('../img/sushiBack.jpg')}>
        <View style={{width:'100%', height:'100%',position:'absolute', backgroundColor:'black', opacity:0.6}}></View>
            <WrapperTutorial width={310} height={543} position={'relative'}/>
            <View style={{position:'absolute', top:'25%', width:'100%', justifyContent:'center', alignItems:'center'}}>
                <Page2text width={'100%'} height={'100%'}/>
            </View>
            <Mslider width={310} height={4} state={'30%'}/>
            <Image source={require('../img/manoSwipe.png')} style={{height:70, width:70, resizeMode:'contain', marginTop:50}}/>
            <Svg width={23} height={18} viewBox={[0,0,23,18].join(" ")}>
                {path.map((d, key) => <Path d={d}  fill="white" strokeWidth={0.2} key={key}/>)}
            </Svg>






        </ImageBackground>
    );
    }
}



export default Tutorial2;
